(self.webpackChunkblog=self.webpackChunkblog||[]).push([[6540],{86540:n=>{n.exports="### oh-my-zsh\n\n* [oh-my-zsh 常见快捷键](https://github.com/robbyrussell/oh-my-zsh/wiki/Cheatsheet)\n\ntake: 创建一个文件夹并进入该文件夹\n\n### 快捷 git 命令查阅\n\n```bash\ncat ~/.oh-my-zsh/plugins/git/git.plugin.zsh\n```\n\n一些常用命令:\n\n```\nga . & gcmsg '..' & gp\ngst === git status\ngco === git checkout\ngcb === git checkout -b\ngb === git branch\n```"}}]);